import React from 'react';
import style from './header.css'
import {Link} from 'react-router-dom';

const Header = () => {
  const logo = ()=>{
    <Link t0="/">

    </Link>
  }
  return (
    <header className={style.header}>
    <div className={style}>
     {logo()}
    </div>
    </header>
  );
};

export default Header;
